import {format} from "date-fns";

export default function Post({title,summary,cover,content, createdAt}) {
    return (
        <div className="post">
        <div className="image">
          <img src="https://www.happiesthealth.com/wp-content/uploads/2023/05/dill-leaves.jpg" />
        </div>
        <div className="text">
          <h2>{title}</h2>
            <hr/>
          <p className="info">
            <a className="author">Dr Vishnupriya Warrier</a>
            <time>{format(new Date(createdAt), 'MMM D, yyyy HH:mm')}</time>
          </p>
            <hr/>
          <p className="summary">{summary}</p>
        </div>
      </div>
    );
};
